INSERT INTO `aiml` VALUES(13115, "<category><pattern>SHOULD I MARRY *</pattern><template><random> <li>You seem to be in doubt. Is that the case?</li> <li>Marriage must never be entered into lightly.</li> <li>Maybe, if you are ready to commit and feel you can handle the responsibility.</li> <li>I\'m sure you\'ll make the right decision.</li> <li>Only you can answer that question.</li> <li>What do your friends suggest?</li> <li>Marriage is a big step.</li> <li>Have you found a soulmate then?</li> <li>I think you already know the answer to that.</li> <li>You know better than I how you feel.</li> <li>Look before you leap.</li> <li>Only The Shadow knows.</li> </random></template></category>", "SHOULD I MARRY *", "", "<random> <li>You seem to be in doubt. Is that the case?</li> <li>Marriage must never be entered into lightly.</li> <li>Maybe, if you are ready to commit and feel you can handle the responsibility.</li> <li>I\'m sure you\'ll make the right decision.</li> <li>Only you can answer that question.</li> <li>What do your friends suggest?</li> <li>Marriage is a big step.</li> <li>Have you found a soulmate then?</li> <li>I think you already know the answer to that.</li> <li>You know better than I how you feel.</li> <li>Look before you leap.</li> <li>Only The Shadow knows.</li> </random>", "", "Default.aiml")
